import React, { useState, useEffect } from "react";
function App() {
    const [data, setData] = useState(null);

    useEffect(() => {
        fetch("/fakeData")
            .then((res) => res.json())
            .then((data) => {
                setData(data);
                console.log(data);
            });
    }, []);

    return <div></div>;
}

export default App;
